import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { HomePage } from "./pages/Home";
import { NotFoundPage } from "./pages/NotFound";
import { LoginPage } from "./pages/Login";

export const navigation = () => {
    return (
        <Router>
            <Routes>
                <Route path="/">
                    <HomePage />
                </Route>
                <Route path="/Login">
                    <LoginPage />
                </Route>
                <Route>
                    <NotFoundPage />
                </Route>
            </Routes>
        </Router>
    )
}
